-- DROP TABLE IF EXISTS scooters;
-- DROP TABLE IF EXISTS customers;
-- DROP TABLE IF EXISTS rental_reservations;
CREATE TABLE scooters (id integer NOT NULL, name_scooter character varying(50) NOT NULL, city character varying(50) NOT NULL, model character varying(50) NOT NULL, battery_capacity character varying(50) NOT NULL);
CREATE TABLE customers(id integer NOT NULL, name_customer character varying(50) NOT NULL, platform_token character varying(50) NOT NULL);
CREATE TABLE rental_reservations (scooter_id integer NOT NULL, customer_id integer NOT NULL, start_datetime timestamp NOT NULL, end_datetime timestamp NOT NULL);
